import Button from './Button';
import Card from './Card';
import classes from './ErrorModal.module.css';

const ErrorModal = (props) => {
    return (
        <Card>
            <header>
                <h2>{props.title}</h2>
            </header>
            <div></div>
            <footer>
                <Button type='submit'>Back</Button>
            </footer>
        </Card>
    );
};

export default ErrorModal;
